INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, "トゥインクルウィッシュ", "A", 155, 16, 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 2, "人助け、応援", 100101, "東山奈央", 0, 8, "ヒヨリ", "人助けが大好き！　前向き格闘娘", "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (47, "トゥインクルウィッシュ", "O", 158, 17, 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 2, "料理、人間観察", 100201, "種田梨沙", 0, 4, "ユイ", "戦闘のサポートが得意な、心優しい少女", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, "トゥインクルウィッシュ", "B", 163, 18, 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 2, "読書、乗馬、お茶", 100301, "早見沙織", 0, 1, "レイ", "クールで何事にも真っ直ぐな剣士", "魔族");
