INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, "悪魔偽王国軍（ディアボロス）", "O", 150, 13, 22, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 7, "サックス", 100601, "浅倉杏美", 0, 11, "アカリ", "甘え上手なみんなの人気者", "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (32, "悪魔偽王国軍（ディアボロス）", "B", 130, 14, 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 7, "プリンを食べること", 100701, "雨宮天", 0, 1, "ミヤコ", "プリン大好きゴースト娘", "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "ヴァイスフリューゲル　ランドソル支部", "AB", 150, 14, 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 15, "鏡で自分を見ること", 100801, "大空直美", 0, 10, "ユキ", "ボクは誰よりも美しい", "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, "トワイライトキャラバン", "A", 159, 17, 5, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 13, "小説執筆", 100901, "髙野麻美", 0, 7, "アンナ", "前世を信じる中二病患者、「疾風の冥姫」", "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, "自警団（カォン）", "O", 155, 16, 22, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 10, "空想、ぬいぐるみ集め", 101001, "内田真礼", 0, 9, "マホ", "マホマホ王国のプリンセス", "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, "ラビリンス", "A", 156, 15, 25, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 3, "お裁縫", 101101, "阿澄佳奈", 0, 8, "リノ", "人懐っこくてマシンガントークな妹系少女", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, "フォレスティエ", "A", 156, 17, 24, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 6, "妹と遊ぶこと、二度寝、昼寝、早寝", 101201, "大橋彩香", 0, 12, "ハツネ", "みんなのために超能力を使う眠り姫", "エルフ");
