INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (41, "自警団（カォン）", "AB", 152, 15, 3, "test", 10, "読書、推理", 101401, "水瀬いのり", 0, 11, "カスミ", "頭脳明晰な美少女名探偵", "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, "フォレスティエ", "O", 165, 21, 5, "test", 6, "絵本作り", 101501, "國府田マリ子", 0, 9, "ミサト", "母性溢れる優しいみんなの「ミサト先生」", "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (48, "ルーセント学院", "O", 167, 18, 10, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 14, "ファッション", 101601, "上坂すみれ", 0, 4, "スズナ", "天真爛漫で人気者のカリスマモデル", "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (53, "自警団（カォン）", "A", 158, 19, 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 10, "踊り、空手", 101701, "高森奈津美", 0, 7, "カオリ", "いつでも「なんくるないさ～」な天然娘", "獣人族");
