INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (21, "リトルリリカル", "O", 117, 10, 3, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 5, "かわいいもの集め", 102001, "日高里菜", 0, 4, "ミミ", "お歌もにんじんも、ウサギさんも大好き♪", "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "サレンディア救護院", "B", 150, 12, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "観劇、おままごと", 102101, "植田佳奈", 0, 6, "クルミ", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "悪魔偽王国軍（ディアボロス）", "O", 150, 13, 22, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 7, "ゲーム全般", 102201, "原紗友里", 0, 11, "ヨリ", "人見知りであまのじゃくな女の子", "魔族");
