INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, "サレンディア救護院", "O", 154, 15, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 9, "ご奉仕", 102501, "悠木碧", 0, 12, "スズメ", "お嬢さまのためにがんばるドジっ娘メイド", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, "牧場（エリザベスパーク）", "B", 144, 17, 1, "test", 11, "あんパン", 102601, "小岩井ことり", 0, 1, "リン", "遊びと睡眠が何より大事なぐうたら娘", "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, "トワイライトキャラバン", "B", 154, 16, 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 13, "実験、裁縫、料理", 102701, "橋本ちなみ", 0, 7, "エリコ", "運命の相手に一途すぎる乙女", "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, "サレンディア救護院", "A", 156, 17, 4, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 9, "経営、お茶会", 102801, "堀江由衣", 0, 10, "サレン", "救護院を経営する優しい庶民派お嬢様", "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "カルミナ", "B", 157, 17, 24, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 4, "舞台鑑賞、ダンス", 102901, "日笠陽子", 0, 1, "ノゾミ", "歌って踊れる大人気アイドル", "ヒューマン");
