INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, "悪魔偽王国軍（ディアボロス）", "AB", 157, 18, 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 7, "占い", 103101, "大坪由佳", 0, 12, "シノブ", "占いが得意な霊能少女", "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, "メルクリウス財団", "AB", 157, 18, 12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "慈善事業", 103201, "松嵜麗", 0, 3, "アキノ", "一人前の商人を目指すパワフルお嬢様", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (35, "牧場（エリザベスパーク）", "B", 142, 20, 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 11, "漫才", 103301, "新田恵海", 0, 3, "マヒル", "みんなを笑顔にするお笑い牧場主", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (55, "メルクリウス財団", "A", 164, 22, 16, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 12, "ウインドーショッピング", 103401, "今井麻美", 0, 3, "ユカリ", "純情でほっとけない大人の女性", "エルフ");
