INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, "王宮騎士団（NIGHTMARE）", "A", 149, 13, 11, "test", 8, "剣術、年長者をからかう", 103701, "茅原実里", 0, 8, "トモ", "義理堅くてからかい好きな剣術少女", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "牧場（エリザベスパーク）", "A", 153, 14, 3, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 11, "読書、お散歩", 103801, "小清水亜美", 0, 11, "シオリ", "読書が趣味の病弱少女", "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, "フォレスティエ", "AB", 158, 13, 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, "友達作りのイメトレ", 104001, "花澤香菜", 0, 6, "アオイ", "「友達」に憧れる、エルフの森の女の子", "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, "カルミナ", "O", 163, 17, 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 4, "各種楽器", 104201, "福原綾香", 0, 6, "チカ", "人々を守るために歌う、唱喚士の少女", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, "自警団（カォン）", "O", 168, 17, 9, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 10, "お菓子作り", 104301, "小松未可子", 0, 8, "マコト", "男勝りで情に厚いワイルド娘", "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (50, "悪魔偽王国軍（ディアボロス）", "A", 172, "??", 5, "test", 7, "世界征服", 104401, "丹下桜", 0, 5, "イリヤ", "かつては夜を支配した最強の吸血鬼", "魔族");
