INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (50, "王宮騎士団（NIGHTMARE）", "A", 171, 25, 25, "？？？", 8, "格闘技、湯浴み", 104701, "川澄綾子", 0, 10, "ジュン", "素顔を見せない冷静沈着な女性騎士", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, "メルクリウス財団", "O", 163, 20, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 12, "傭兵などのアルバイト", 104801, "田所あずさ", 0, 11, "ミフユ", "仕事も私事も効率優先な傭兵少女", "ヒューマン");
