INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, "悪魔偽王国軍（ディアボロス）", "AB", 157, 18, 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 7, "占い", 108101, "大坪由佳", 0, 12, "シノブ（ハロウィン）", "占いが得意な霊能少女", "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (32, "悪魔偽王国軍（ディアボロス）", "B", 130, 14, 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 7, "プリンを食べること", 108201, "雨宮天", 0, 1, "ミヤコ（ハロウィン）", "プリン大好きゴースト娘", "魔族");
