INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, "カルミナ", "O", 163, 17, 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 4, "各種楽器", 108401, "福原綾香", 0, 6, "チカ（クリスマス）", "人々を守るために歌う、唱喚士の少女", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "サレンディア救護院", "B", 150, 12, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "観劇、おままごと", 108501, "植田佳奈", 0, 6, "クルミ（クリスマス）", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (38, "サレンディア救護院", "B", 148, 14, 10, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 9, "屋内でできる遊び", 108601, "芹澤優", 0, 5, "アヤネ（クリスマス）", "ぷうきちといつも一緒！", "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, "トゥインクルウィッシュ", "A", 155, 16, 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 2, "人助け、応援", 108701, "東山奈央", 0, 8, "ヒヨリ（ニューイヤー）", "人助けが大好き！　前向き格闘娘", "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (47, "トゥインクルウィッシュ", "O", 158, 17, 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 2, "料理、人間観察", 108801, "種田梨沙", 0, 4, "ユイ（ニューイヤー）", "戦闘のサポートが得意な、心優しい少女", "ヒューマン");
